import React from 'react'

const Image = ({ baseClase, image={}, alt }) => (
    <img
        className={ `${baseClase}__image` }
        srcSet={ `
            ${image.imageS} 768w,
            ${image.imageM} 1200w,
            ${image.imageL} 1440w,
        ` }
        sizes="(max-width: 768px) 700px,
            (max-width: 1200px) 1000px,
            1440px"
        src={ image.imageL }
        alt={ alt }
    />
);

export default Image;
